import React from 'react';
import './PhotoGallery.css'
import WSPGallery from './WSPGallery';

function PhotoGallery () {
    const galleryImages = [
        {
            img: 'https://www.dropbox.com/scl/fo/kh6mgyamn8v7wau6pnjna/ANaHRVmi9JYMILREeEKByHs?rlkey=p0c07sr5szq30gpltuefu2tnh&st=qmxuyk7y&dl=0'
        },
        {
            img: '/images/IMG2.jpeg'
        },
        {
            img: '/images/IMG3.jpeg'
        },
        {
            img: '/images/IMG4.jpeg'
        },
        {
            img: '/images/IMG5.jpeg'
        },
        {
            img: '/images/IMG6.jpeg'
        },
        {
            img: '/images/IMG7.jpeg'
        },
        {
            img: '/images/IMG8.jpeg'
        }
    ]
    return (
        <div class='gallery'>
            <h1>Noel's Photography</h1>
            <br />
            <WSPGallery
                galleryImages={galleryImages}
            />
        </div>
    );
}

export default PhotoGallery;
